function displayProviderCards(all) {
	if (all) {
		for (var i = idsCards.length - 1; i >= 0; i--) {
			document.getElementById(idsCards[i]).style.display = "block";
		};
	} else {
		for (var i = idsCards.length - 1; i >= 0; i--) {
			document.getElementById(idsCards[i]).style.display = values[i];
		};
	};
}

function displayProviderSections(all) {
	if (all) {
		for (var i = ids.length - 1; i >= 0; i--) {
			document.getElementById(ids[i]).style.display = "initial";
		};
	} else {
		for (var i = ids.length - 1; i >= 0; i--) {
			document.getElementById(ids[i]).style.display = values[i];
		};
	};
}